import { Component } from '@angular/core';

@Component({
  selector: 'app-registering',
  templateUrl: './registering.component.html',
  styleUrls: ['./registering.component.css']
})
export class RegisteringComponent {

  register(){
    console.log("dupa tu jestem");
  }
}
<div class = "container">
    <div class = "form">
            <div class = "inputs">
                <p>Nick:</p>
                <input class = "nick" type="text">
            </div>
            <div class = "inputs">
                <p>EMail:</p>
                <input class = "email" type="tel">
            </div>
            <div class = "inputs">
                <p>Password:</p>
                <input class = "password" type="tel">
            </div>
            <div class = "inputs">
                <button (click)="register();" class = "add">Dodaj</button>
            </div>
    </div>
</div>
